('000000000016', '00001', '000000011', 'Димин холодильник', 'Первые домашние холодильники появились тоже в середине 19 века. Тогда это были обыкновенные деревянные шкафы, набитые льдом. Через 20 лет, в 1879 году немецкий учёный Карл фон Линде изобрёл холодильную машину с компрессором. Это был механический холодильник, в котором использовался паровой насос.', '987987', '', '[{\"id\":\"000000070\",\"index\":1,\"is_title\":true,\"type\":0,\"value\":\"\"},{\"id\":\"000000001\",\"index\":2,\"is_title\":false,\"type\":8,\"value\":\"392\"}]', '000002', NULL, NULL, 20),
('000000000017', '00005', '000000006', 'Xiaomi Redmi 9T (голубой)', 'Смартфон Xiaomi Redmi 9T оснащен камерой из 4 модулей 48+8+2+2, позволяющей делать снимки с высокой детализацией, отличные панорамные снимки, портреты с эффектом боке и осуществлять макросъёмку. Мощный 8-ядерный процессор обеспечит высокую производительность даже в самых требовательных играх. На дисплее 6.53 дюйма с пониженным излучением в синем спектре комфортно выполнять любые привычные задачи даже при длительном использовании. Два динамика создадут эффект полного погружения при просмотре фильма или игре. Сканер отпечатков пальцев, встроенный в кнопке питания, надежно защитит ваши данные. Емкого аккумулятора на 6000 мАч хватит на 17 часов просмотра видео, 56 часов разговора и на 195 часов прослушивания музыки.', '21375731', '', '[{\"id\":\"000000017\",\"index\":1,\"is_title\":true,\"type\":0,\"value\":\"\"},{\"id\":\"000000014\",\"index\":2,\"is_title\":false,\"type\":4,\"value\":\"000000011\"},{\"id\":\"000000003\",\"index\":3,\"is_title\":false,\"type\":6,\"value\":\"000010\"},{\"id\":\"000000025\",\"index\":4,\"is_title\":false,\"type\":4,\"value\":\"000000015\"},{\"id\":\"000000004\",\"index\":5,\"is_title\":false,\"type\":7,\"value\":\"000000002\"},{\"id\":\"000000001\",\"index\":6,\"is_title\":false,\"type\":8,\"value\":\"156\"},{\"id\":\"000000027\",\"index\":7,\"is_title\":false,\"type\":2,\"value\":12},{\"id\":\"000000028\",\"index\":8,\"is_title\":false,\"type\":1,\"value\":\"беспроводная зарядка; быстрая зарядка\"},{\"id\":\"000000032\",\"index\":9,\"is_title\":true,\"type\":0,\"value\":\"\"},{\"id\":\"000000029\",\"index\":10,\"is_title\":false,\"type\":2,\"value\":6.4},{\"id\":\"000000036\",\"index\":11,\"is_title\":false,\"type\":4,\"value\":\"000000040\"},{\"id\":\"000000037\",\"index\":12,\"is_title\":false,\"type\":4,\"value\":\"000000016\"},{\"id\":\"000000038\",\"index\":13,\"is_title\":false,\"type\":3,\"value\":true},{\"id\":\"000000039\",\"index\":14,\"is_title\":true,\"type