('000000000024', '00004', '000000006', 'Смартфон Samsung Galaxy A72 128Gb (черный)', 'Смартфон A72 сбалансированное решение, которое легко справится с любыми повседневными делами и развлечениями. Аккуратный минималистичный дизайн смартфона подойдет всем, а высококачественные материалы обеспечат долговечность. Большой и яркий SuperAMOLED-дисплей с диагональю 6,7 дюйма и разрешением FHD+ отобразит естественные цвета и детали видео и фотографий высокой четкости, а также современных игр с богатой графикой. Экран Samsung Galaxy A72 поддерживает частоту обновления в 90 Гц, что гарантирует плавную смену картинки без потери четкости при пролистывании лент и сайтов. За игры с высоким уровнем графики, общее быстродействие системы и многозадачность отвечает современный мощный чипсет Snapdragon 720G и большое количество высокоскоростной оперативной памяти. Внутреннего хранилища в 128 ГБ более чем достаточно для установки необходимых приложений и хранения внушительной медиатеки, а слот для карт памяти в любой момент позволит его дополнительно расширить.', '23667906', '', '[{\"id\":\"000000017\",\"index\":1,\"is_title\":true,\"type\":0,\"value\":\"\"},{\"id\":\"000000014\",\"index\":2,\"is_title\":false,\"type\":4,\"value\":\"000000011\"},{\"id\":\"000000003\",\"index\":3,\"is_title\":false,\"type\":6,\"value\":\"000012\"},{\"id\":\"000000004\",\"index\":5,\"is_title\":false,\"type\":7,\"value\":\"000000001\"},{\"id\":\"000000001\",\"index\":6,\"is_title\":false,\"type\":8,\"value\":\"704\"},{\"id\":\"000000027\",\"index\":7,\"is_title\":false,\"type\":2,\"value\":12},{\"id\":\"000000028\",\"index\":8,\"is_title\":false,\"type\":1,\"value\":\"быстрая зарядка; сканер отпечатка пальца; технология распознавания лица\"},{\"id\":\"000000032\",\"index\":9,\"is_title\":true,\"type\":0,\"value\":\"\"},{\"id\":\"000000029\",\"index\":10,\"is_title\":false,\"type\":2,\"value\":6.7},{\"id\":\"000000036\",\"index\":11,\"is_title\":false,\"type\":4,\"value\":\"000000041\"},{\"id\":\"000000037